
CREATE TABLE IF NOT EXISTS `units_of_measure` (
  `common_code` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `level_and_category` varchar(255) NOT NULL,
  `level_and_category2` varchar(255) DEFAULT NULL,
  `symbol` varchar(255) NOT NULL,
  `conversion_factor` varchar(255) NOT NULL,
  PRIMARY KEY (`common_code`),
  KEY `units_of_measure_level_and_category_foreign` (`level_and_category`),
  KEY `units_of_measure_level_and_category2_foreign` (`level_and_category2`),
  CONSTRAINT `units_of_measure_level_and_category2_foreign` FOREIGN KEY (`level_and_category2`) REFERENCES `levels_and_categories` (`level_and_category`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `units_of_measure_level_and_category_foreign` FOREIGN KEY (`level_and_category`) REFERENCES `levels_and_categories` (`level_and_category`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

